window.bookSummaryJSON = "<p><b>Hiding from her problems as she vacations at a beach house, Gloria's only concerns are walking her dog, relaxing by the pool, and kayaking. Then she spots a strange sea-creature stalking her as she paddles around a secluded cove.</b></p> <p>Little does she know the mysterious creature is a tentacle alien!</p> <p>Lu cannot help but follow this pretty Earth human around while he is waiting for rescue. He knew that humans were adorable, but this one draws his attention and entrances him. He never intended to reveal himself, but everything changes when the object of his fascination is attacked and he must intervene to save her.</p> <p><i>Chasing Cthulhu is a slow-burn alien/human romance intended for adult listeners.</i></p>"; 
